北濱城隍廟位於蘇澳鎮南安國中校地內，倚山面海。北濱城隍廟原係位於蘇澳鎮北方澳聚落，1970年代政府欲執行「龍淵計畫」，在北方澳設立海軍「中正基地」，因此在1975年時將北方澳聚落居民全數遷村至南方澳北濱一村與北濱二村，大眾廟亦隨之遷建，並在今南安國中校園內山麓處新建廟宇。主神大眾爺之聖誕為每年農曆五月初五日。2008（民國97）年6月5日，經縣長呂國華晉封昇格為城隍廟。 　　北濱城隍廟在城隍爺神像兩側，各有三面執事牌，除各有一面書以「北濱城隍爺」外，其餘則各書以「肅靜」、「迴避」，以及「申冤」、「釋放」，亦呈現出北濱城隍爺似具有司法神之職能。

